    [],nt"revision_timestamp": "2016-07-27T22:42:02.771165",nt"name": "evaluating-environmental-contaminants-at-tijuana-slough-national-wildlife-refuge-and-sweet",nt"isopen":
    false,nt"url": null,nt"notes": "It appears that in comparison, Sweetwater
    Marsh National Wildlife Refuge had higher levels of environmental contaminants than
    did Tijuana Slough National Wildlife Refuge. A variety of organic and inorganic
    contaminants were present at both Tijuana Slough NWR and Sweetwater Marsh NWR in
    sediments and an array of species. Those species included invertebrates, plants,
    fish, and birds. However, the concentrations of most organic compounds and inorganic
    elements appeared to be below biologically significant threshold levels. Nevertheless,
    long-term bioaccumulation of contaminants can result in impacts and is cause of
    concern.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
